import "./dashbb.css";

export default function Dashbb({myUploads}) {
  return (
    <div className="dashbb-g">
      <div className="row-md">
          <div className="book">
            <ul>
              {myUploads.myUploads.map((m)=>(
              <li style={{fontSize: "2em"}}>{m.bookTitle} <p className="purchase-count" style={{fontSize: "0.5em"}}>Sold: 20</p></li>
              ))}
            </ul>
          </div>
      </div>
    </div>
  );
}
